import React, {Component} from 'react';

import Search from './Search'
import Video from './Video'
import InputQuestion from './InputQuestion'

class VideoSearch extends Component {
    state = {videoIsSelected: null};

    getVideoData = video => {
        this.setState({videoIsSelected: !!video})
    };
    getPlayerTime = () => {
        console.log(this.videoRef)
        return this.videoRef.current.getTimeThatPassed();
    };

    render() {
        const videoIsSelected = !(this.state.videos === undefined || this.state.videos.length === 0);
        return (
            <React.Fragment>
                <Search getVideoData={this.getVideoData}/>
                <Video/>
                <div style={{
                    "display": "flex",
                    "justifyContent": "center"
                }}>
                    {videoIsSelected && <InputQuestion getPlayerTime={this.getPlayerTime}/>}
                </div>
            </React.Fragment>
        );
    }
}

export default VideoSearch;
